import "./Card.css";

const Card = ({ name, age, yearGraduated, program, yearsExp, salary, gender, jobHuntDuration }) => {
  console.log(gender)
  return (
    <article className="card">
      <p className="name">Name:</p>
      <p className="age">Age: </p>
      <p className="year-graduated">Year Graduated: </p>
      <p className="salary">Salary: ${salary}</p>
      <p className="gender">Gender: {gender}</p>
      <p className="job-hunt-duration">Job Hunt Duration: {jobHuntDuration} days</p>
    </article>
  );
};

export default Card;
